import React from "react";
import { CloseIcon, SidebarContainer } from "./SidebarElement";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
    </SidebarContainer>
  );
};
export default Sidebar;
